import React from "react";
import LabelOneField from "./LabelOneField";
import LabelTwoFields from "./LabelTwoFields";
import LabelThreeFields from "./LabelThreeFields";
import LabelOneSelect from "./LabelOneSelect";

function HomeInformation( {nameBox} ){
    return (
        <div className="form-box">
            <h3>{nameBox}</h3>
            <LabelOneField 
                labelText={"Dirección de residencia:"}
                inputId={"home_address"}
                inputPlaceholder={"Dirección de residencia"}
                inputType={"text"}
                required={true}
            />

            <div className="two-field-container">
                <LabelOneField
                    labelText={"Barrio:"}
                    inputId={"home_neighborhood"}
                    inputPlaceholder={"Nombre Barrio"}
                    inputType={"text"}
                    required={true}
                />

                <LabelOneSelect 
                    labelText={"Entidad Bancaria:"} 
                    selectText={"Seleccione municipio de residencia"}
                    initialOptions={['MEDELLÍN', 'ABEJORRAL', 'ABRIAQUÍ', 'ALEJANDRÍA', 'AMAGÁ', 'AMALFI', 'ANDES', 'ANGELÓPOLIS', 'ANGOSTURA', 'ANORÍ', 'SANTAFÉ DE ANTIOQUIA', 'ANZA', 'APARTADÓ', 'ARBOLETES', 'ARGELIA', 'ARMENIA', 'BARBOSA', 'BELMIRA', 'BELLO', 'BETANIA', 'BETULIA', 'CIUDAD BOLÍVAR', 'BRICEÑO', 'BURITICÁ', 'CÁCERES', 'CAICEDO', 'CALDAS', 'CAMPAMENTO', 'CAÑASGORDAS', 'CARACOLÍ', 'CARAMANTA', 'CAREPA', 'EL CARMEN DE VIBORAL', 'CAROLINA', 'CAUCASIA', 'CHIGORODÓ', 'CISNEROS', 'COCORNÁ', 'CONCEPCIÓN', 'CONCORDIA', 'COPACABANA', 'DABEIBA', 'DON MATÍAS', 'EBÉJICO', 'EL BAGRE', 'ENTRERRIOS', 'ENVIGADO', 'FREDONIA', 'FRONTINO', 'GIRALDO', 'GIRARDOTA', 'GÓMEZ PLATA', 'GRANADA', 'GUADALUPE', 'GUARNE', 'GUATAPE', 'HELICONIA', 'HISPANIA', 'ITAGUI', 'ITUANGO', 'JARDÍN', 'JERICÓ', 'LA CEJA', 'LA ESTRELLA', 'LA PINTADA', 'LA UNIÓN', 'LIBORINA', 'MACEO', 'MARINILLA', 'MONTEBELLO', 'MURINDÓ', 'MUTATÁ', 'NARIÑO', 'NECOCLÍ', 'NECHÍ', 'OLAYA', 'PEÑOL', 'PEQUE', 'PUEBLORRICO', 'PUERTO BERRÍO', 'PUERTO NARE', 'PUERTO TRIUNFO', 'REMEDIOS', 'RETIRO', 'RIONEGRO', 'SABANALARGA', 'SABANETA', 'SALGAR', 'SAN ANDRÉS DE CUERQUÍA', 'SAN CARLOS', 'SAN FRANCISCO', 'SAN JERÓNIMO', 'SAN JOSÉ DE LA MONTAÑA', 'SAN JUAN DE URABÁ', 'SAN LUIS', 'SAN PEDRO', 'SAN PEDRO DE URABA', 'SAN RAFAEL', 'SAN ROQUE', 'SAN VICENTE', 'SANTA BÁRBARA', 'SANTA ROSA DE OSOS', 'SANTO DOMINGO', 'EL SANTUARIO', 'SEGOVIA', 'SONSON', 'SOPETRÁN', 'TÁMESIS', 'TARAZÁ', 'TARSO', 'TITIRIBÍ', 'TOLEDO', 'TURBO', 'URAMITA', 'URRAO', 'VALDIVIA', 'VALPARAÍSO', 'VEGACHÍ', 'VENECIA', 'VIGÍA DEL FUERTE', 'YALÍ', 'YARUMAL', 'YOLOMBÓ', 'YONDÓ', 'ZARAGOZA', 'BARRANQUILLA', 'BARANOA', 'CAMPO DE LA CRUZ', 'CANDELARIA', 'GALAPA', 'JUAN DE ACOSTA', 'LURUACO', 'MALAMBO', 'MANATÍ', 'PALMAR DE VARELA', 'PIOJÓ', 'POLONUEVO', 'PONEDERA', 'PUERTO COLOMBIA', 'REPELÓN', 'SABANAGRANDE', 'SABANALARGA', 'SANTA LUCÍA', 'SANTO TOMÁS', 'SOLEDAD', 'SUAN', 'TUBARÁ', 'USIACURÍ', 'BOGOTÁ', 'CARTAGENA', 'ACHÍ', 'ALTOS DEL ROSARIO', 'ARENAL', 'ARJONA'