            </div>

            <LabelThreeFields 
                labelText={"Teléfono 1:"}
                inputId={"telephone1"}
                inputPlaceholder={"Teléfono 1"}
                inputType={"number"}

                labelText2={"Teléfono 2:"}
                inputId2={"telephone2"}
                inputPlaceholder2={"Teléfono 2"}
                inputType2={"number"}

                labelText3={"Celular:"}
                inputId3={"cellphone"}
                inputPlaceholder3={"Celular"}
                inputType3={"number"}
                required={true}
            />

            <LabelOneField 
                labelText={"Correo Electrónico Personal:"}
                inputId={"email"}
                inputPlaceholder={"Correo Electrónico Personal"}
                inputType={"text"}
                required={true}
            />
        </div>
    );
